      <h2>주요 변경점</h2>
      <p>Galmuri14·11·9의 한글은 Nintendo의 원본이 존재하지만 Galmuri는 가독성과 일관성을 위해 여러 글자의 자형을 수정하거나 기존 2,355자였던 한글 음절을 최대 11,172자까지 늘리는 등 아래의 내용 외에도 여러 부분을 개선하였습니다.</p>
      <small>Galmuri11 Bold·11 Condensed·7의 한글은 다른 것을 기반으로 하지 않고 아예 새로 만들어졌습니다.</small>
